INSERT INTO `mall_config` VALUES ('2', '用户隐私', 'user_privacy', '{\"text\": \"我们会遵循隐私政策收集、使用您的信息，但不会仅因您同意本隐私政策而采用强制捆绑的方式一揽子收集个人信息,当您使用或开启相关功能或使用服务时，为实现功能、服务所必需，我们会收集、使用相关信息。除非是为实现基本业务功能或根据法律法规要求所必需的必要信息，您均可以拒绝提供且不影响其他功能或服务。我们将在隐私政策中逐项说明哪些是必要信息。 如果您未登录帐号，我们会通过设备对应的标识符信息来保障信息推送的基本功能。如果您登录了帐号，我们会根据帐号信息实现信息推送。为了帮您发现更多好友，我们可能会申请通讯录权限。我们尊重您的选择权，如果您不希望被推荐给好友，您可以在“我—设置—隐私设置”中随时关闭。通讯录、精确地理位置、摄像头、麦克风、相册权限，均不会默认开启，只有经过您的明示授权才会在为实现特定功能或服务时使用，您也可以撤回授权。特别需要指出的是，即使经过您的授权，我们获得了这些敏感权限，也不会在相关功能或服务不需要时而收集您的信息\"}');
INSERT INTO `mall_config` VALUES ('3', '提现说明', 'withdraw', '{\"text\": \"如果一年累计提现超过限定数要收取提现金额1%的手续费。\"}');
INSERT INTO `mall_config` VALUES ('4', '商家入驻说明', 'merchant', '{\"text\": \"上传经营资质文件，填写店铺基本信息。包含营业执照信息、组织机构代码、税务登记信息、一般纳税人资格证（可上传工商局一般纳税人资格认定网页截图）、银行开户许可证。（注：以上材料均需加盖公司公章，若营业执照已办理三证合一，则营业执照号、组织机构代码和纳税人识别号以统一社会信用代码为准）。店铺经营范围应与营业执照一致且具备在平台销售所申报类目的资质。品牌资质要求：1.所有的品牌均需上传相符的商标注册证。若非品牌持有方，则需要提供授权证明，授权链需完整并可追溯至品牌注册持有方。2.授权的有效期限建议至少一年。3.行业资质信息应根据国家相关规定上传对应商品的行业资质证件如“《食品生产许可证》、《食品流通许可证》、《食品经营许可证》”“3C认证”“质量检测报告”等。我们会尽快处理您提交的入驻申请，在此期间，您可以直接登录商家平台查看审核结果及详细审核意见。\"}');
